        "vaeua-gui-eua.sas.van.control.initialValue.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Angir den opprinnelige (standard-)verdien for kontrollen. Den opprinnelige verdien velges første gang en bruker åpner rapporten eller når han eller hun velger <span class\\="xis-windowItem">Gjenopprett standard rapportstatus</span>. </p><div class\\="xis-paragraph">Skriv inn en verdi i tekstfeltet, eller angi én av følgende\\: <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Automatisk</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">angir at valget lagres som opprinnelig verdi når du lagrer rapporten. </p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Første</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple"> angir at den første verdien i kontrollen er den opprinnelige verdien.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-userSuppliedValue">parameter-navn</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">angir at verdien til parameteren som du valgte er den initielle verdien for kontrollen.</p><p class\\="xis-paraSimple">Du kan velge en parameter kun hvis en parameter med den adekvate datatypen allerede finnes.</p></dd></dl></div>                 </div><p class\\="xis-paragraph">Hvis den opprinnelige verdien ikke er med i dataspørringen (for eksempel på grunn av et filter) og kontrollen ikke er nødvendig, har den ingen opprinnelige verdi. Hvis kontrollen er nødvendig, velges den første verdien som opprinnelig verdi.</p></section>',
