        "vaeua-gui-eua.barLabelFitPolicy.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Alternativet <span class\\="xis-windowItem">Overlapphåndtering</span> angir metoden som brukes til å vise stolpeetiketter når det ikke er nok plass til å vise dem, og de overlapper hverandre.</p><div class\\="xis-paragraph">                      <div class\\="xis-listValueDescription"><table><tr><td class\\="xis-value"><span class\\="xis-windowItem">Auto</span></td><td>justerer etiketter automatisk.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">Ingen</span></td><td>utfører ingen overlapphåndtering.</td></tr></table></div>                 </div></section>',
        "vaeua-gui-eua.sas.van.ReportReview.HighCustomCategoryEntries.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Reduser antallet tilpassede kategorier for å eliminere følgende problem. For eksempel, for å eliminere lavprioritetsproblemer, må du redusere antallet beregninger i rapporten til maksimalt 25.</p><p class\\="xis-paragraph">Lav prioritet\\: inneholder &gt; 25 tilpassede kategorier</p></section>',
