        "vaeua-gui-eua.discreteTickValueFitPolicy.help.content.txt": '<section class\\="xis-topicContent"><div class\\="xis-paragraph">Alternativet <span class\\="xis-windowItem">Håndtering av overlapping av kategoriske verdier</span> angir metoden som brukes til å justere aksemerkeverdier på aksen når det ikke er nok plass til å vise dem, og de overlapper hverandre. Den angitte metoden brukes bare ved behov, med unntak av <span class\\="xis-windowItem">Roter alltid</span>. Ellers vises aksemerkeverdiene uten endring. <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Forskyv, avkutt, dropp alt</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">flytter verdiene opp og ned, kutter av tegn fra verdiene og dropper deretter alle verdiene.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Vis alle</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">viser alle verdier selv om det finnes overlappende verdier.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Roter</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">roterer alle verdier diagonalt.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Roter alt</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">roterer alle verdier diagonalt uansett om de overlapper hverandre.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Roter alltid, dropp alt</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">roterer alle verdier diagonalt, og dropper deretter alle verdier.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Forskyv</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">flytter verdiene opp og ned.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Forskyv, avkutt</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">flytter verdiene opp og ned og kutter deretter av tegnene fra verdiene.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Avkutt</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">kutter av tegn fra verdiene.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Avkutt, roter</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">kutter av tegn fra verdiene og roterer deretter alle verdiene diagonalt.</p></dd></dl></div>                 </div></section>',
