        "vaeua-gui-eua.Properties.linearRegression.significanceLevel.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Utfører hurtig bakover-variabelvalg for å bestemme hvilke variabler som skal overveies for modellopprettelse. Det tas bare høyde for variabler med <span class\\="xis-userSuppliedValue">p</span>-verdier under det angitte signifikansnivået.</p></section>',
        "vaeua-gui-eua.sas.van.ReportReview.SlowReportLoad.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Rapporten bruker lang tid på å laste inn den første siden. Hvis SAS Visual Analytics identifiserer andre problemer med ytelse enn lang innlastingstid, må du løse disse problemene først. Hvis ingen andre problemer med ytelse er identifisert, kontakter du administratoren for å bestemme om andre faktorer har følger for rapporten. For eksempel kan en langsom tilkobling føre til at rapporten lastes inn langsomt.</p><p class\\="xis-paragraph">Lav prioritet\\: tar &gt; \\= 5 sekunder</p><p class\\="xis-paragraph">Middels prioritet\\: tar &gt; \\= 10 sekunder</p><p class\\="xis-paragraph">Høy prioritet\\: tar &gt; \\= 25 sekunder</p></section>',
