        "vaeua-gui-eua.Properties.neuralnetwork.activationlabel.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Angir aktiveringsfunksjonen som brukes til å opprette utdatalaget ved bruk av normal distribusjon for å modellere responsen. Den eksponensielle aktiveringsfunksjonen brukes med gamma- eller Poisson-distribusjon. </p></section>',
