        "vaeua-gui-eua.Properties.predAuto.includeMissing.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Utvider analysen til å inkludere observasjoner med manglende verdier. For kategorifaktorer behandles manglende verdier på eget nivå når analysen utføres. For målingsfaktorer behandles manglende verdier i beregningen av verdien av en oppdelingsregel. Det produseres en oppdelingsregel som tildeler manglende verdier til grenen som maksimerer oppdelingens verdi.</p></section>',
