        "vaeua-gui-eua.connectOrder.help.content.txt": '<section class\\="xis-topicContent"><div class\\="xis-paragraph">Alternativet <span class\\="xis-windowItem">Koblingsrekkefølge</span> angir hvordan du kobler til datapunktene for å forme plottelinjene. <div class\\="xis-listValueDescription"><table><tr><td class\\="xis-value"><span class\\="xis-windowItem">Akse</span></td><td>kobler sammen datapunktene slik de står fra venstre til høyre på X-aksen.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">Data</span></td><td>kobler sammen datapunktene i den rekkefølgen de leses i fra X-rollen.</td></tr></table></div>                 </div><p class\\="xis-paragraph">Du kan bruke denne verdien for å kontrollere rekkefølgen på koblingen når inndataene ikke er sortert etter X-rollen.</p></section>',
