        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.cluster.nClusters.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Angir antallet klynger som skal opprettes, eller angir at metoden med innstilt boks-kriterium (ABC) skal brukes til å avlede et optimalt antall klynger.</p><p class\\="xis-paragraph">ABC-metoden velger først et antall klynger for å opprette, oppretter dem og beregner avstandsstatistikk for hver klynge. Deretter opprettes en referansedistribusjon omkring hver klynge, og avstandsstatistikken for hver referansedistribusjon beregnes. Denne prosessen gjentas for alle potensielle klyngeantall. Antall klynger som maksimerer den totale forskjellen mellom avstandsstatistikk for klyngene og referansedataene, velges som optimalt antall klynger.</p><p class\\="xis-paragraph">ABC-metoden er gyldig kun når alle inndata er målevariabler.</p></section>',
