        "vaeua-gui-eua.Properties.partialdependence.numBins.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Angir antallet intervaller som skal brukes til å kategorisere målingsvariablene i Delvis avhengighet-plotten.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.rapidGrowth.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Aktiverer hurtigsøkalgoritmen for k-middelverdiklynging og ignorerer intervallrekkefølgen. Ikke velg dette alternativet hvis du ønsker å bruke den grådige søkemetoden og respektere intervallrekkefølgen. Målresponser uten inndeling i verdiintervaller bruker varians som utvalgskriterium. Når dette alternativet er valgt, bruker kategoriresponsene og målresponsene i intervaller økningsratiokriterie. Ellers brukes absolutt økning.</p></section>',
