        "vaeua-gui-eua.Properties.bayesNet.naive.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Forsøk på å opprette et naivt bayesiansk nettverk og et naivt bayesiansk nettverk som er økt med et bayesiansk nettverk. Et naivt bayesiansk nettverk angir at responsvariabelen er det eneste overordnede elementet for alle prediktorer. Det antar betinget uavhengighet av alle prediktorer grunnet responsvariabelen. Et naivt bayesiansk nettverk økt med et bayesiansk nettverk utvider det naive nettverket ved å gjøre det mulig for prediktornodene å danne et bayesiansk nettverk.</p></section>',
