        "vaeua-gui-eua.sas.van.ShareDialog.embeddableLink.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Genererer HTML-tilpassede etiketter slik at objektet eller rapporten kan innkapsles på en nettside.</p><p class\\="xis-paragraph">For å aktivere tilpassede etiketter på din nettside må du også legge til &lt;script&gt;-koder i sidetoppteksten. For mer informasjon om innkapsling av SAS Visual Analytics-innhold, se <a href\\="https\\://developer.sas.com/sdk/va/docs/getting-started/" target\\="_blank" rel\\="noopener noreferrer">SAS Visual Analytics SDK-dokumentasjonen</a>.</p></section>',
