        "vaeua-gui-eua.sas.van.control.initialMaxValue.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Angir den opprinnelige maksimumsverdien (øvre grense) for kontrollen. Den opprinnelige verdien velges første gang en bruker åpner rapporten eller når han eller hun velger <span class\\="xis-windowItem">Gjenopprett standard rapportstatus</span>. </p><div class\\="xis-paragraph">Skriv inn en verdi i tekstfeltet, eller angi én av følgende\\: <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Automatisk</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">angir at valget lagres som opprinnelig verdi når du lagrer rapporten. </p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Maksimumsverdi</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">angir at den høyeste verdien i kontrollen er den opprinnelige verdien.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-userSuppliedValue">parameter-navn</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">angir at verdien til parameteren som du valgte er den initielle verdien for kontrollen.</p><p class\\="xis-paraSimple">Du kan velge en parameter kun hvis en parameter med den adekvate datatypen allerede finnes.</p></dd></dl></div>                 </div></section>',
        "vaeua-gui-eua.Properties.bayesNet.prescreenPredictors.help.aria.txt": "Hjelp. Mer informasjon om dette alternativet ",
        "vaeua-gui-eua.react.va.geo.search.includeTraffic.help.content.txt": '<section class\\="xis-topicContent"><div class\\="xis-paragraph">Angir hvordan trafikk brukes til å beregne reisetid for den grafiske funksjonen. Velg ett av følgende alternativer\\: <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Nei</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">Angir at reisetidsberegningen bruker et veiet middeltall av historiske trafikkdata for alle dagens tidspunkter og for alle dager i uken.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Nåværende trafikk</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">Angir at reisetidberegningen bruker nåværende trafikkforhold. Disse trafikkdataene kan oppdateres ved å klikke på <span data-icon-name\\="refresh" alt\\="ikonet Oppdater trafikkdata" aria-label\\="ikonet Oppdater trafikkdata"></span>. Når en bruker viser en rapport, oppdateres ikke trafikken automatisk. Brukeren må oppdatere trafikkdataene slik at de reflekterer de siste trafikkforholdene.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Typisk trafikk</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple"> angir at reisetidberegningen bruker typisk trafikk for det angitte klokkeslettet og dagen i uken. De typiske trafikkbetingelsene baseres på nylige historiske data.</p><div class\\="xis-note"><span class\\="xis-noteGenText">Merk\\:</span> Tidspunktet som du angir er det lokale tidspunktet for plasseringen på kartet.</div></dd></dl></div>                 </div><div class\\="xis-note"><span class\\="xis-noteGenText">Merk\\:</span>Henting av reisetiddata forbruker kreditter hos Esri Premium-tjenester.</div><div class\\="xis-note"><span class\\="xis-noteGenText">Merk\\:</span>Hvis ingen trafikkdata er tilgjengelig for området som inneholder reisetidberegningen, brukes posterte fartsgrenser til å beregne reisetiden.</div></section>',
