        "vaeua-gui-eua.sas.van.views.layout.panels.SplitNodePanel.logWorth.definition.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Velg variabelen som skal brukes til å dele noden. Variabler sorteres etter loggverdi som måler hvor godt den variabelen deler dataene. Loggverdien er den negative loggen av p-verdien fra chi-kvadrattesten.</p></section>',
