        "vaeua-gui-eua.Properties.neuralnetwork.validateError.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Angir maksimalt antall valideringsfeil som kan godtas for å fullføre modellæring. Modellæringen avsluttes når valideringsfeilen er under angitt målverdi.</p></section>',
