        "vaeua-gui-eua.discreteTickValueFitPolicy.help.tip.txt": "Mer informasjon om dette alternativet ",
        "vaeua-gui-eua.Distribution.label.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Angir distribusjonsfunksjonen som brukes til å modellere responsvariabelen.</p></section>',
        "vaeua-gui-eua.dataElementStyleRotation.help.content.txt": '<section class\\="xis-topicContent"><div class\\="xis-paragraph">Alternativet <span class\\="xis-windowItem">Dataelementets stilrotasjon</span> angir hvordan stilene tilordnes til dataelementene i diagrammalen. I et linjediagram spesifiserer for eksempel dette alternativet hvordan farger, linjemønstre og markører brukes for å skjelne mellom linjer i diagrammet. <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Automatisk</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">bruker stilrotasjonsinnstillingen fra temaet. De fleste SAS-temaer bruker innstillingen <span class\\="xis-windowItem">Roter først alle farger</span>. Høykontrasttemaet bruker innstillingen <span class\\="xis-windowItem">Roter alle attributter</span>.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Roter først alle farger</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">viser en heltrukket, fylt linje og en konsistent markørform til alle fargene i paletten er brukt.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Roter alle attributter</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">viser forskjellige fyllmønstre, linjemønstre og markørformer i tillegg til forskjellige farger. Denne innstillingen kan forbedre tilgjengeligheten for fargeblinde brukere.</p></dd></dl></div>                 </div></section>',
        "vaeua-gui-eua.sas.van.ShareDialog.useGuestAccess.help.aria.txt": "Hjelp. Mer informasjon om dette alternativet ",
        "vaeua-gui-eua.Properties.svm.sigmoidParameterOne.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Angir parameteren skala (koeffisient) i sigmoidfunksjonen.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.network.communities.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Angir antallet fellesskap (lokale nodegrupperinger) som skal beregnes i hver nodeklynge. Merk at det totale antallet beregnede fellesskap kan være under den valgte verdien, avhengig av nettverksstrukturen og -størrelsen.</p></section>',
