        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.extractNounGroups.help.tip.txt": "Mer informasjon om dette alternativet ",
        "vaeua-gui-eua.Properties.bayesNet.includeMissing.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Kategoriske prediktorer behandler en manglende verdi som en separat verdi. En kontinuerlig prediktor erstatter en manglende verdi med prediktorens middelverdi. For Bayesianske nettverk inkluderes ikke manglende verdier i responsvariabelen.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.network.forceStrength.help.aria.txt": "Hjelp. Mer informasjon om dette alternativet ",
        "vaeua-gui-eua.Properties.svm.defaultpenalty.help.tip.txt": "Mer informasjon om dette alternativet ",
        "vaeua-gui-eua.groupingScale.help.content.txt": '<section class\\="xis-topicContent"><div class\\="xis-paragraph">Alternativet <span class\\="xis-windowItem">Grupperingsskala</span> bestemmer hvordan du skalerer diagrammer med grupperte stolper. Stolpene kan stables eller settes i klynge. <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Faktiske verdier</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">bestemmer stolpenes størrelse ut fra dataverdiene. La oss for eksempel anta at en stolpe i en gruppe har en verdi på 50 og en stolpe i en annen gruppe, 500. 500-stolpen vil bli 10 ganger høyere enn 50-stolpen.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Normaliser grupper til 100 %</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">presenterer gruppene ved hjelp av en relativ skala. I en gruppe vises hver stolpe som en prosent av gruppen. For eksempel, anta at en gruppe har en totalverdi på 100. Hvis en stolpe i denne gruppen har en verdi på 50, er stolpen 50 % av den globale gruppens høyde.</p></dd></dl></div>                 </div><p class\\="xis-paragraph">Dette alternativet er ikke tilgjengelig når diagramobjektet inneholder overlagte diagramelementer. Alternativet er altså ikke tilgjengelig når du spesifiserer samme dataområde for aksene i et gitter.</p></section>',
        "vaeua-gui-eua.connectOrder.help.aria.txt": "Hjelp. Mer informasjon om dette alternativet ",
        "vaeua-gui-eua.properties.sankey.linkColor.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Farger koblinger etter stiene de tilhører, hendelsene som de startet fra eller hvorvidt de er drop-off-koblinger.</p></section>',
        "vaeua-gui-eua.sas.van.Options.alternativeText.help.aria.txt": "Hjelp. Mer informasjon om dette alternativet ",
